import React from 'react';

function Footer() {
  return (
    <footer className="bg-dark text-white text-center py-3">
      <div className="container">
        <p>Call Us 24/7 123-456-7890</p>
        <p>Follow us on social media</p>
      </div>
    </footer>
  );
}

export default Footer;
